import React, { useEffect, useState } from "react";

export default function CheckinsPage() {
  const [checkins, setCheckins] = useState([]);

  useEffect(() => {
    fetch("http://127.0.0.1:8000/api/checkins/")
      .then((res) => res.json())
      .then((data) => setCheckins(data));
  }, []);

  return (
    <div>
      <h1 className="text-2xl font-bold mb-4 text-red-800">Check-in Management</h1>
      <table className="w-full bg-white shadow rounded-lg overflow-hidden">
        <thead className="bg-red-600 text-white">
          <tr>
            <th className="p-3 text-left">Student ID</th>
            <th className="p-3 text-left">Time</th>
          </tr>
        </thead>
        <tbody>
          {checkins.map((checkin) => (
            <tr key={checkin.id} className="border-b hover:bg-gray-100">
              <td className="p-3">{checkin.student}</td>
              <td className="p-3">{new Date(checkin.time).toLocaleString()}</td>
            </tr>
          ))}
        </tbody>
      </table>
    </div>
  );
}
